<p>My Case Schema is as follows:</p>
<pre><code>const caseSchema = new mongoose.Schema({
    patient: {
        type: String,
        default: 'Password can\'t be empty' 
    }
    description: {
        type: String,
        required: 'Case description can\'t be empty'
    },
    assessments: [assessmentSchema]
});

</code></pre>
<p>My Assessment Schema is as follows</p>
<pre><code>const assessmentSchema = new mongoose.Schema({
    doctor: {
        type: String,
        required: 'Doctor can\'t be empty'
    },
    doa: Date,
    slots: String
});

</code></pre>
<p>My problem here is to find all the assessment documents in the entire collection(where the doctor and doa is specified). But as these details are available only in the Sub Schema, I have no idea on how to approach this problem. And I also cannot add a doctor field to the Case Schema as there might be many doctors in a case. I'm using mongoose. I searched many places on the internet and was not able to arrive at a solution. Please help me.</p>

