Determine differences between incoming CSV data and existing Mongo collection for large data sets<p>I have an incoming CSV that I am trying to compare with an existing collection of mongo documents (<code>Note</code> objects) to determine additions, deletions, and updates. The incoming CSV and mongo collection are quite large at around 500K records each.</p>
<p>ex. csv_data</p>
<pre><code>[{
 id: 1, text: &quot;zzz&quot;
}, 
{
 id: 2, text: &quot;bbb&quot;
}, 
{
 id: 4, text: &quot;ddd&quot;
}, 
{
 id: 5, text: &quot;eee&quot;
}]
</code></pre>
<p>Mongo collection of <code>Note</code> objects:</p>
<pre><code>[{
 id: 1, text: &quot;aaa&quot;
}, 
{
 id: 2, text: &quot;bbb&quot;
}, 
{
 id: 3, text: &quot;ccc&quot;
}, 
{
 id: 4, text: &quot;ddd&quot;
}]
</code></pre>
<p>As a result I would want to get</p>
<p>an array of additions</p>
<pre><code>[{
 id: 5, text: &quot;eee&quot;
}]
</code></pre>
<p>an array of removals</p>
<pre><code>[{
 id: 3, text: &quot;ccc&quot;
}]
</code></pre>
<p>an array of updates</p>
<pre><code>[{
 id: 1, text: &quot;zzz&quot;
}]
</code></pre>
<p>I tried using <code>select</code> statements to filter for each particular difference but it is failing / taking hours when using the real data set with all 500k records.</p>
<pre><code>additions = csv_data.select{|record| !Note.where(id: record[:id]).exists?}
deletions = Note.all.select{|note| !csv_data.any?{|row| row[:id] == note.id}}
updates = csv_data.select do |record|
    note = Note.where(id: record[:id])
    note.exists? &amp;&amp; note.first.text != record[:text]
end
</code></pre>
<p>How would I better optimize this?</p>

