This has also been used from time to time in an emergency - because the server name (or SID in some protocol variations) is a key that must be globally unique, a misbehaving server may be locked out of the network by bringing on a placeholder server to occupy it's name, thus insuring any link that would introduce that server to the net fails - a technique referred to as "juping" the server.

