}

module.exports.home = function(req, res) {
  res.json(articles);
}
</code></pre>
<p>This works fine when I add articles and list them through <code>home</code> route. But after a day passes, I see all my articles are gone.</p>
<p>I deployed this app on google cloud using:</p>
